import React from 'react';
import Listing from '../components/listing';

const listings = props => {
  const listings = props.data.map(l_data => <Listing data={l_data} />);

  return (
    <div>
      <div className='row'>
        <div className='col-1-of-3'>{listings}</div>
      </div>
    </div>
  );
};

export default listings;
